import React, { Component } from "react";

class Message extends Component {
  constructor() {
    super();
    this.state = {
      message: "hello"
    };
  }

  changeMessage(){}
  render() {
    return (
      <div>
        <h1>{this.state.message}</h1>
    <button onClick>{()=>this.changeMessage()}subscribe</button>
      </div>
    );
  }
}
export default Message;
